%spark

// So we can access IRIS!
import com.intersystems.spark._

// So we can export our final model to PMML
import com.intersystems.spark.ml._
//import org.jpmml.sparkml.PMMLBuilder

import spark.implicits._

import org.apache.spark.sql.functions._

// For calculating Chi2 - Should try to convert this to pure Spark ML instead of using mllib
import org.apache.spark.mllib.linalg._
import org.apache.spark.mllib.stat._

// Transformers to prepare the features for training
import org.apache.spark.ml.feature.VectorAssembler

// This will help us to pick the best features on our pipeline accordingly to Chi2
import org.apache.spark.ml.feature.ChiSqSelector

// Parameter grid and cross validators to allow us to automatically run estimators with 
// different parameters and validate which configuration is best for our data
import org.apache.spark.ml.tuning.ParamGridBuilder
import org.apache.spark.ml.tuning.CrossValidator

// Algorithms (Estimators) to train our models (Transformers)
import org.apache.spark.ml.classification.RandomForestClassifier
import org.apache.spark.ml.classification.DecisionTreeClassifier

// To Evaluate the model against the test data
import org.apache.spark.ml.evaluation.MulticlassClassificationEvaluator
import org.apache.spark.ml.evaluation.BinaryClassificationEvaluator

// Models
import org.apache.spark.ml.classification.RandomForestClassificationModel

// Pipepeline to connect transformers and estimators 
import org.apache.spark.ml.Pipeline

%spark

val cat_cols = List("age", "gender", "merchant", "category")
val alpha=0.05

def calculate_chi(df: org.apache.spark.sql.DataFrame, col1: String, col2: String): org.apache.spark.mllib.stat.test.ChiSqTestResult = {
   val test = df.stat.crosstab(col2, col1).drop(col2+"_"+col1)
   val values = test.rdd.map(x => List(x(0).asInstanceOf[Double], x(1).asInstanceOf[Double])).flatMap(y => y).collect()
   val matrix = Matrices.dense(2, 2, values)
   return Statistics.chiSqTest(matrix)
}

